import React from 'react';
import { createStackNavigator } from "@react-navigation/stack";
import { Ionicons } from '@expo/vector-icons';
import { TouchableOpacity } from 'react-native-gesture-handler';

import {HomeScreen} from '../ScreemFolder/OtherScreen';
import {DetailUserScreen} from '../ScreemFolder/UserScreen';
import {UserStoryScreen, 
  NewStory, 
  CategoryScreen, 
  ReadingScreen, 
  DetailStoryScreen
} from '../ScreemFolder/StoryScreen'
import {UserTopStack} from '../NavigationScreen'


const HomeStack = createStackNavigator();
const HomeStackScreen = (props, {navigation}) => (
<HomeStack.Navigator mode="modal">
    <HomeStack.Screen 
      name="Home" 
      component={HomeScreen}
      options = {{
       headerShown: false
      }}
    />  
    <HomeStack.Screen 
      name="DetailStory" 
      options = {{
        title: 'Detail story',
        headerStyle: {
          backgroundColor: '#8a2be2',
        },
        headerTintColor: '#fff',
       }}
      component={DetailStoryScreen}
    />
    <HomeStack.Screen 
      name="DetailCategory" 
      options = {{
        title: 'Category story',
        headerStyle: {
          backgroundColor: '#8a2be2',
        },
        headerTintColor: '#fff',
       }} 
      component={CategoryScreen}/>
    <HomeStack.Screen 
      name="DetailUser" 
      options = {{
        title: 'Your pages',
        headerStyle: {
          backgroundColor: '#8a2be2',
        },
        headerTintColor: '#fff',
       }}  
      component={DetailUserScreen} 
    />
    <HomeStack.Screen 
      name="UserButtonStack" 
      component={UserTopStack} 
    />
    <HomeStack.Screen 
      name="Reading" 
      label= 'Reading' 
      component={ReadingScreen} 
      options={{
        tabBarVisible: false,
        headerStyle: {
          backgroundColor: '#8a2be2',
        },
        headerTintColor: '#fff',
        headerRight: ()=> (
          <TouchableOpacity>
            <Ionicons name="md-menu" size={40} color="white" style={{marginRight: 20}} />
          </TouchableOpacity>
        )
      }}
    />
    <HomeStack.Screen
      name="YourStory"
      component={UserStoryScreen} 
      options = {{
        title: 'Your story',
        headerStyle: {
          backgroundColor: '#8a2be2',
        },
        headerTintColor: '#fff',
        headerRight: () => (
          <TouchableOpacity onPress={()=>navigation.navigate('NewPart')}>
            <AntDesign name="addfile" size={24} color="white" style={{marginRight: 10}} />
          </TouchableOpacity>
        ),
      }}

    />
    <HomeStack.Screen
      name="NewPart"
      component={NewStory} 
      options = {{
        title: 'Write your story',
          headerStyle: {
            backgroundColor: '#8a2be2',
          },
          headerTintColor: '#fff',
        }}
    />
  </HomeStack.Navigator>
)
export {HomeStackScreen};
